import{_ as t}from"./chunks/position_fixed.t2m3lWVy.js";import{_ as a,c as i,a8 as o,o as l}from"./chunks/framework.BDnHobkS.js";const p=JSON.parse('{"title":"着陆模式（多旋翼）","description":"","frontmatter":{},"headers":[],"relativePath":"zh/flight_modes_mc/land.md","filePath":"zh/flight_modes_mc/land.md"}'),r={name:"zh/flight_modes_mc/land.md"};function d(n,e,s,h,m,c){return l(),i("div",null,e[0]||(e[0]=[o('<h1 id="着陆模式-多旋翼" tabindex="-1">着陆模式（多旋翼） <a class="header-anchor" href="#着陆模式-多旋翼" aria-label="Permalink to &quot;着陆模式（多旋翼）&quot;">​</a></h1><img src="'+t+'" title="Position estimate required (e.g. GPS)" width="30px"><p>The <em>Land</em> flight mode causes the vehicle to land at the position where the mode was engaged. 这辆车在降落后不久将被解除武装(默认)。</p><div class="info custom-block"><p class="custom-block-title">INFO</p><ul><li>Mode is automatic - no user intervention is <em>required</em> to control the vehicle.</li><li>Mode requires at least a valid local position estimate (does not require a global position). <ul><li>Flying vehicles can&#39;t switch to this mode without valid local position.</li><li>Flying vehicles will failsafe if they lose the position estimate.</li></ul></li><li>Mode prevents arming (vehicle must be armed when switching to this mode).</li><li>遥控开关可以在任何无人机上更改飞行模式。</li><li>RC stick movement in a multicopter (or VTOL in multicopter mode) will <a href="#COM_RC_OVERRIDE">by default</a> change the vehicle to <a href="./../flight_modes_mc/position.html">Position mode</a> unless handling a critical battery failsafe.</li><li>The mode can be triggered using the <a href="https://mavlink.io/en/messages/common.html#MAV_CMD_NAV_LAND" target="_blank" rel="noreferrer">MAV_CMD_NAV_LAND</a> MAVLink command, or by explicitly switching to Land mode.</li></ul></div><h2 id="技术总结" tabindex="-1">技术总结 <a class="header-anchor" href="#技术总结" aria-label="Permalink to &quot;技术总结&quot;">​</a></h2><p>无人机将降落在模式所指定的位置。 The vehicle descends at the rate specified in <a href="#MPC_LAND_SPEED">MPC_LAND_SPEED</a> and will disarm after landing (by <a href="#COM_DISARM_LAND">default</a>).</p><p>RC stick movement will change the vehicle to <a href="./../flight_modes_mc/position.html">Position mode</a> (by <a href="#COM_RC_OVERRIDE">default</a>).</p><h3 id="参数" tabindex="-1">参数 <a class="header-anchor" href="#参数" aria-label="Permalink to &quot;参数&quot;">​</a></h3><p>Land mode behaviour can be configured using the parameters below.</p><table tabindex="0"><thead><tr><th>参数</th><th>描述</th></tr></thead><tbody><tr><td><a id="MPC_LAND_SPEED"></a><a href="./../advanced_config/parameter_reference.html#MPC_LAND_SPEED">MPC_LAND_SPEED</a></td><td>着陆过程中的下降速率。 鉴于地面情况未知，这个值应该设得相当小。</td></tr><tr><td><a id="COM_DISARM_LAND"></a><a href="./../advanced_config/parameter_reference.html#COM_DISARM_LAND">COM_DISARM_LAND</a></td><td>降落后自动上锁的超时时间，以秒为单位。 如果设定为 -1，无人机将不会在着陆时上锁。</td></tr><tr><td><a id="COM_RC_OVERRIDE"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a></td><td>Controls whether stick movement on a multicopter (or VTOL in MC mode) causes a mode change to <a href="./../flight_modes_mc/position.html">Position mode</a>. 可以分别为自动模式和 offboard 模式启用此功能，默认情况下在自动模式下启用此功能。</td></tr><tr><td><a id="COM_RC_STICK_OV"></a><a href="./../advanced_config/parameter_reference.html#COM_RC_STICK_OV">COM_RC_STICK_OV</a></td><td>The amount of stick movement that causes a transition to <a href="./../flight_modes_mc/position.html">Position mode</a> (if <a href="#COM_RC_OVERRIDE">COM_RC_OVERRIDE</a> is enabled).</td></tr></tbody></table><h2 id="see-also" tabindex="-1">See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;See Also&quot;">​</a></h2><ul><li><a href="./../flight_modes_fw/land.html">Land Mode (FW)</a></li><li><a href="./../flight_modes_vtol/land.html">Land Mode (VTOL)</a></li></ul>',12)]))}const u=a(r,[["render",d]]);export{p as __pageData,u as default};
